import React, {useState} from 'react'
import logo from './header-images/logo.svg'


function Header(){
  const [name,setName] = useState('Alt')
  return(
      <header>
    <button onClick={()=>{
      setName()
    }}>
    {name}
    </button>
      <img src={logo} alt="logo" />

    </header>
  )
}

export default Header
